Первая сдача 1к квартиры. Общая площадь 37/17/9, в новом доме ЖК Патриотика Дарницкий р-н. ул.Б.ГМЫРИ 14. Квартира с ремонтом, в прихожей, балконе и кухне на полу плитка.В квартире есть: 
КОМНАТА—гардероб, диван, мебельный гарнитур, письменный стол со стулом; телевизор LCD SAMSUNG, ковер, кресло-груша;
ПРИХОЖАЯ—новая мебель для прихожей с зеркалом;
КУХНЯ—новые кухонная мебель, холодильник, встроенные электро поверхность и духовка, вытяжка, СВЧ, чайник, частично посуда, обеденный стол и 4 стула;
ВАННАЯ—стиральная машина, бойлер, большое зеркало с LED подсветкой, коврик, множество полок. 
ЕЩЕ ЕСТЬ—пылесос, швабра с ведром, щетка с совком, гладильная доска, сушка для вещей, колорифер, две подушки.Доукомплектация по договоренности.
Дом 2017 года постройки, с современными лифтами, современным ремонтом в подъезде, консьерж, дом утепленный. В квартире имеются счетчики воды и тепла, а также пожарная сигнализация. Супер транспортная развязка и инфраструктура: м.Осокорки, Позняки 10 мин. пешком, маршрутное такси 545(м.Дарница),407(Дарницкий ЖД), автобус 42(м.Левобережная), гимназии и школы, детские сады и поликлиники, а также ТЦ Алладин, Пирамида, супермаркеты Novus, Billa, METRO, Эпицентр. Цена + комунальные.

Бизнес-центр «Евразия», класс А, оснащен: 
- современной охранной системой с видеонаблюдением и системой контроля допуска в здание; 
- системой кондиционирования и вентиляции здания с возможностью регулировать микроклимат в каждом отдельном офисе; 
- противопожарной системой с оповещением в случае возникновения пожара; 
- телекоммуникационной системой. 
Ближайшая станция метро «Университет».
Площадь - 117,4 м2 (полезная 101.1 м2); 
Расположено на 10 этаже. 
Имеет планировку: 3 кабинета, кухня, санузлы, ресепшн. 
Коммерческие условия: арендная ставка: 24 долл./кв.м. включая НДС. 
ОРЕХ (эксплуатационные расходы): 7,2 долл./кв.м. включая НДС.
Паркинг подземный - 200 долл./паркоместо без НДС; паркинг наземный - 100 долл./паркоместо без НДС.

Квартира у гарному стані, тепла та затишна, с загальною площею 55 кв. м. Розташована на третьому поверсі будинку за адресою: Осокорки, вул. Урлівська 21Б. Будівлі десять років, навколо чиста теріторія, відеонагляд.

Складається з наступних приміщень:

1) Коридор, з шафою-купе;
2) Гардеробна;
3) Ванна кімната (ванна+душ, пральна машина, бойлер, тепла підлога, велика шафа);
4) Спальня (двоспальне ліжко з ортопедичним матрацом і білизною, комод, тумбочки, кондиціонер);
5) Балкон-кабінет (комп'ютерний стіл, полиці, тепла підлога);
6) Кухня-вітальня:
а) Кухонна зона включає в себе посудні шафи і всю необхідну техніку, плюс посудомийну машину. Посуд BergHOFF, тепла підлога, стіл на дві персони;
б) Вітальна зона — диван (двуспальне ліжко), телевізор, кондиціонер;
7) Комора (полиці, місце для зберігання різноманітних речей);

Вікна виходять на південь та південний захід. В наявності лічильники води, електрики та опалення.

Додатково за бажанням: телебачення, інтернет, щотижневе прибирання;

Найближчі станції метро: "Осокорки" або "Лівобережна" (15 хвилин автобусом);
Зручний виїзд на правий берег через Дарницький міст.
Поруч: Магазини "Novus", "Billa", "ATБ", аптеки, спортзали, хімчистка, кафе, ресторани, платна парковка;
В десяти хвилинах: Торговий центр "Аркадія", "Сільпо";

Перевага буде надаватись самотнім персонам або парам без дітей, домашніх тварин та шкідливих звичок.

