Бизнес-центр «Карнеги Центр» расположен в деловой и самой активной части Печерского, Кловский спуск 7-а, которая выделяется хорошим транспортным и пешеходным трафиком. Транспортная доступность обеспечивается наличием станции метро «Кловская» и близлежащих остановок разного общественного транспорта. Удобные подъезды, выезды на основные столичные магистрали, круглосуточная доступность объекта - отличные условия для предпринимателей, которые хотят иметь максимальный доступ к своему рабочему месту.
Аренда офиса в бизнес-центре «Карнеги Центр» также отличается своей выгодностью за счет соседства с известными киевскими бизнес-центрами, ресторанами, бутиками, государственными учреждениями и зонами отдыха горожан.
Технические характеристики бизнес-центра:
Бизнес-центр «Карнеги Центр» располагает классом комфортности «В» и насчитывает 16 этажей с общей площадью в 23920 кв.м. Деловой центр оборудован передовыми инженерными системами:
1.	центральной системой управления всеми инженерными системами здания;
2.	приточно-вытяжной системой вентиляции;
3.	системой кондиционирования воздуха;
4.	автономной системой отопления;
5.	4 лифтами Sigma;
6.	телекоммуникационной системой;
7.	противопожарной системой;
8.	охранной системой с видеонаблюдением.
Здание делового центра также оборудовано многоуровневым подземным паркингом на 250 м/м.

