Бизнес-центре «Rubin» позволит арендаторам наслаждаться классом комфорта «В» и при этом иметь неограниченный допуск к своему рабочему месту. Бизнес-центр «Rubin» расположился на улице Крутой спуск, строение 7. Близость к улице Бассейной и бульвару Тараса Шевченко обеспечивает хорошую транспортную доступность к объекту, а также удобные подъезды к главному входу. Еще одной особенностью размещения этого делового центра является близость объекта сразу к трем станциям метро: «Л. Толстого площадь», «Театральная» и «Майдан Независимости». Расстояние до каждой станции метро можно преодолеть всего за несколько минут ходьбы.
Технические возможности бизнес-центра
Бизнес-центр «Rubin» своим арендаторам предлагает максимально комфортные условия, которые поддерживаются благодаря первоклассному техническому оснащению здания:
1.	централизованной системы вентиляции;
2.	климат-контролю в каждом офисе;
3.	автономной системы отопления;
4.	телекоммуникационной системы;
5.	охранной и пожарной сигнализацией;
6.	скоростным лифтом;
7.	системой допуска в здание;
8.	видеонаблюдением.
Автовладельцы могут оставить свои машины на гостевом паркинге, рассчитанном на 15 м/м. Арендаторам предоставлена отдельная парковка на 5 м/м.
Аренда офиса в бизнес-центре «Rubin» - это комфортные офисные площадки в высотном здании, которое насчитывает 11 этажей и 2590 кв.м. общей площади.
Аренда офиса в бизнес-центре «Rubin» предоставляется клиентам в виде офисных блоков со смешанной планировкой.

